// SPDX-License-Identifier: MIT

pragma solidity ^0.8.17;

import "../node_modules/openzeppelin-solidity/contracts/access/Ownable.sol";
import "./MintNFT.sol";

import "../node_modules/openzeppelin-solidity/contracts/utils/Strings.sol";

// operator address 
contract Sale is Ownable {
    address mintAddress;
    
    MintNFT mintContract; // import 

    //  property  => value 
    // tokenID : price
    mapping(uint => uint) public tokenPrices; //      mapping 
    //    uint    uint ??

    constructor(address _mintAddress) {
        mintAddress = _mintAddress;
        mintContract = MintNFT(_mintAddress); // mintNFT       
        // mintNFT.       
    }

    // Token info 
    struct TokenInfo{
        uint tokenId;
    }

    function setPermission() public {
        mintContract.setApprovalForAll(address(this), true);
    }

    function setForSale(uint _tokenId, uint _price) public  {

        address tokenOwner = mintContract.ownerOf(_tokenId); // ownerOf()  ,    
        require(tokenOwner == msg.sender, "Not owner.");
        require(_price > 0, "Price type is only uint without 0"); //  0      
        require(tokenPrices[_tokenId] == 0, "already sale.");
        require(mintContract.isApprovedForAll(tokenOwner, address(this)), "Not approved."); //          

        tokenPrices[_tokenId] = _price * 10 ** 18; //        
    }

    function test() public view returns(address) {
        return address(this);
    }


    function purchase(uint _tokenId) public payable {
        uint price = tokenPrices[_tokenId]; //   
        address tokenOwner = mintContract.ownerOf(_tokenId); //   

        require(price > 0, "not sale."); //   
        require(price <= msg.value, "more bnb."); // msg.value :       ,  price   
        require(tokenOwner != msg.sender, "owner not buy."); //  !=   

        // payable(owner()).tranfer(100);
        payable(tokenOwner).transfer(msg.value); //   msg.value .
        mintContract.safeTransferFrom(tokenOwner, msg.sender, _tokenId); //     nft 

        //        ,         
        tokenPrices[_tokenId] = 0; //  0     

    }

    //  nft  
        function getOwnerToken(address _tokenOwner) public view returns (TokenInfo[] memory){
        uint balance = mintContract.balanceOf(_tokenOwner);
        require(balance != 0);
        // balance    list
        TokenInfo[] memory list = new TokenInfo[](balance);

        for (uint i = 0; i < balance; i++) {
            //      
            uint tokenId = mintContract.tokenOfOwnerByIndex(_tokenOwner, i);

            list[i] = TokenInfo(tokenId);
        }
        return list;
    }
}
